import './App.css';
import { useEffect, useState } from "react"

function App() {
  console.log("Hello!");

  couseState();

  useEffect(() => {
    const reqBody = {
      "username": "trevor",
      "password": "asdfasdf"
    };

    fetch("api/auth/login", {
      headers: {
        "Content-Type":"application/json",
      },
      method: "post",
      body: JSON.stringify(reqBody)
    })
    .then((response) => Promise.all([response.json(), response.headers]))
      .then(([body,headers]) => {
        const jwt = headers.get("authorization");
        console.log(jwt);
        console.log(body);
      });
  }, []);

  return (
    <div className="App">
      Hello World
    </div>
  );
}

export default App;
